import React,{useState,Component} from 'react';
import classes from './TopInfoBar.module.css';
import TopInfoBarInstructor from './TopInfoBarInstructor';
import TopInfoBarButton from './TopInfoBarButton.js';
import { withRouter,useHistory } from 'react-router-dom';

const  TopInfoBarUserProfile =(props) =>  {

let history = useHistory();	


const moveToSetting=()=>{

  history.push('/account/settings');

}

const moveToCourses=()=>{

  history.push('/account/courses');

}





return (



<div className={classes.topInfoBar}>

       <TopInfoBarInstructor/>

       <TopInfoBarButton  styles={props.styles}  buttonName={'Profile'}/>

       <TopInfoBarButton onPress={moveToSetting}  buttonName={'Settings'}/>

       <TopInfoBarButton onPress={moveToCourses}   buttonName={'Courses'}/>




</div>



);




}


export default TopInfoBarUserProfile;
